import React from 'react';
import logo from './logo.svg';
import './App.css';
import Compass from "./components/compass"



class App extends React.Component {
  constructor(props) {
    super(props);
    this.setState((state) => {
      return {heading: 0}
    });
  }

  componentDidMount() {
    this.interval = setInterval(() => this.setState((state) => {
      return {heading: this.state.heading + 1};
    }, 1000));
  }

  render() {
    return (
      <div>
        <Compass width={200} height={200} heading={this.state.heading}/>
      </div>
    );
  }
}

export default App;
